import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";
import { Card, Box, Typography, CardContent } from "@mui/material";

import PokemonAbilities from "./Components/PokemonAbilites";
import HomePage from "./Components/HomePage";

function App() {
  const [name, setName] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:5001/pokemon/");
      setName(response.data.data);
    };
    fetchData();
  }, []);
  return (
    <div className="App">
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          padding: "20px",
        }}
      >
        <Card sx={{ borderRadius: "8px", boxShadow: 3 }}>
          <CardContent>
            <Typography variant="h6" component="div">
              <HomePage /> <br />
            </Typography>
          </CardContent>
        </Card>
      </Box>

      <Box
        className="button-group"
        sx={{
          display: "flex",
          alignItems: "center",
          gap: "10px",
          marginTop: "20px",
        }}
      ></Box>
    </div>
  );
}
export default App;
